import React from 'react';
import './Footer.css';

const Footer = () => {
  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      // Add offset for fixed header
      const offset = 80;
      const elementPosition = element.getBoundingClientRect().top + window.pageYOffset;
      window.scrollTo({
        top: elementPosition - offset,
        behavior: 'smooth'
      });
    }
  };

  return (
    <footer className="footer">
      <div className="container">
        <div className="row">
          <div className="col-md-4 mb-4">
            <h4 className="footer-title">LivingLink</h4>
            <p>The modern solution for residential society management. Streamline operations, enhance communication, and improve transparency.</p>
            <div className="social-icons">
              <a href="#"><i className="fab fa-facebook"></i></a>
              <a href="#"><i className="fab fa-twitter"></i></a>
              <a href="#"><i className="fab fa-instagram"></i></a>
              <a href="#"><i className="fab fa-linkedin"></i></a>
            </div>
          </div>
          
          <div className="col-md-4 mb-4">
            <h5 className="footer-title">Quick Links</h5>
            <ul className="footer-links">
              <li><a href="/">Home</a></li>
              <li><a href="#features" onClick={(e) => {
                e.preventDefault();
                scrollToSection('features');
              }}>Features</a></li>
              <li><a href="#testimonials" onClick={(e) => {
                e.preventDefault();
                scrollToSection('testimonials');
              }}>Testimonials</a></li>
              <li><a href="#about" onClick={(e) => {
                e.preventDefault();
                scrollToSection('about');
              }}>About</a></li>
            </ul>
          </div>
          
          <div className="col-md-4 mb-4">
            <h5 className="footer-title">Contact Us</h5>
            <ul className="footer-links">
              <li><i className="fas fa-map-marker-alt me-2"></i> 123 Tech Park, Innovation City</li>
              <li><i className="fas fa-phone me-2"></i> +91 98765 43210</li>
              <li><i className="fas fa-envelope me-2"></i> info@livinglink.com</li>
              <li><i className="fas fa-clock me-2"></i> Support: 24/7</li>
            </ul>
          </div>
        </div>
        
        <div className="copyright">
          <p>&copy; 2023 LivingLink. All rights reserved.</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
